import React from "react";
import { Route, Redirect } from "react-router-dom";
export default function ProtectedRoute({ loggedIn, children }) {
	return loggedIn ? children :

	(
		<Route>
			{() =>
				props.loggedIn ? <Component {...props} /> : <Redirect to="/sign-in" />
			}
		</Route>
	);
}
